import React from 'react'
import PropTypes from 'prop-types'

const GoongSlider = props => {

    const { data } = props

    return (
        <div className="goong-slider">
            {
                data.map((item, index) => (
                    <GoongSliderItem key={index} value={item} />
                ))
            }
        </div>
    )
}

const GoongSliderItem = props => (
    <div className="goong-slider__item">
        <div className="goong-slider__item__info">
            <div className="goong-slider__item__info__title">
                <span>{props.item.title}</span>
            </div>
        </div>
    </div>
)


GoongSlider.propTypes = {
    data: PropTypes.array.isRequired
}

export default GoongSlider
